     getCategories().then(data=>{
       if(data?.err){
         console.log(data.err)
       }
       else{
        return  data;
       }
     })
  }

  return (
    <Base title="assignment">
    {preload}
    <p> JSON.Stringify(data)</p>

    </Base>
  )
}
